import React from "react";
import {First, LastName} from "./App";

const CompC =() =>{
    return(
        
        <First.Consumer>  
        {(fname)=>{
            return(
                <LastName.Consumer>
                    {(lastName)=>{
                        return(
                            <>
                            <h1>Welcome! {fname} {lastName}</h1>

                           </>
                        )
                    }}
                </LastName.Consumer>
                
            )
        }}
        </First.Consumer>
        
            
        
    );

};

export default CompC;
